/*! ModuleConcatenation bailout: Module is not an ECMAScript module */function(e,t){e.exports='<h1 id="emek-iler">Emekiler</h1>\n<p>Emekiler maa karlnda  hizmet veren tekliflerdir, maalarn blok zincirinden alrlar. Bir emeki teklifi en azndan aadaki bilgileri kapsamaldr :</p>\n<ul>\n<li>Bir balang ve biti tarihi</li>\n<li>Gndelik bir cret</li>\n<li>Maksimum bir toplam maa</li>\n</ul>\n<p>Emeki teklifinin daha detayl anlatld bir web sayfasna da balant sunmaldr.</p>\n<p>Emeki tekliflerine verilen oylar pozitif yada negatif olabilirler, yani beenmediiniz bir teklife red oyu kullanabilirsiniz.</p>\n<h2 id="emek-i-b-t-esi-mekanizmas-">Emeki btesi mekanizmas</h2>\n<p>Emekilerin cretleri, ilk-gelen ilk-alr prensibiyle gnlk sabit bir bteden para tkenene kadar denir. Nasl ilediini grmek iin u rnee bakn:</p>\n<ul>\n<li>Tm Emekiler iin gnlk toplam bte 400 bin CYB olsun</li>\n<li>Her biri gnlk 100k CYB talep eden toplam oylarn pozitif olduu 5 emeki teklifi</li>\n</ul>\n<p>Oylarn ouna sahip 4 emekinin her birine gnlk 100 bin CYB denecek, fakat demeler tamamlandnda emeki btesi tkenmi olacak. O yzden 5. emekiye hi bir ey denmeyecek.</p>\n'},
