/*! no static exports found */
/*! all exports used */
/*! ModuleConcatenation bailout: Module is not an ECMAScript module */function(e,t){e.exports='<h1 id="tan-k">Tank</h1>\n<p>Tanklar yeni bloklar ina etmek suretiyle blokzincirine alan kimselerdir.\nHer tank, hissedarlar tarafndan onaylanr ve tasdikli ilemlerden bloklar inaa eder \nve imzalar. An iinde gerekleen her ilem en sonunda tm tanklar tarafndan \ntasdik  edilmek zorundadr.</p>\n<h2 id="mutabakat-mekanizmas-">Mutabakat Mekanizmas</h2>\n<p>Kimin tam olarak hangi anda blok <em>rettii</em> , <em>Delegated Proof of Stake</em> \n(Yetkilendirilmi-vekil-pay-ispat) denilen mutabakat mekanizmasyla belirlenir. \nEsasnda, Cybex hissedarlar (elinde CYB kuponu olan)  tercih edilen blok \nreticilerine blokzincirinde oy verebilirler. O <em>tanklar</em> ad verilen, en ok oyu alan \nkimselerin bloklar retmelerine msade edilir.</p>\n'},
