/*! no static exports found */
/*! all exports used */
/*! ModuleConcatenation bailout: Module is not an ECMAScript module */function(e,t){e.exports='<h1 id="c-zdan">Czdan</h1>\n<p>u ana kadar farketmi olduunuz gibi bu uygulama bir web uygulamasdr ve \ntarayac ierisinde alr. Ekosistemin geri kalanna geit grevi gren , ada bulunan \ngvenilir bir dm(node) balant kurar. test</p>\n<h2 id="c-zdan-g-venli-i">Czdan Gvenlii</h2>\n<p>iniz rahat olsun , sunucularmzn fonlarnza eriimi mmkn deildir, nk zel \nanahtarlarnzn hibiri asla taraycnzdan ayrlmazlar. Onun yerine , parola cmlenizle \nkriptolanm vaziyette yerel taraycnzn veritabannda sakl tutulurlar.\nO yzden, bilgisayar arzalar ve tarayc kmelerine kar mutlaka uygun bir \n<a href="../introduction/backups.md">Backup</a> yapmay ihmal etmeyin. </p>\n<h2 id="c-zdan-y-netimi">Czdan Ynetimi</h2>\n<p>Dahas , bu kullanc arayz , birden ok sayda ve ierisinde muhtemel birok \nhesap ve bunlara ait fonlar bulunduran ayr czdanlar muhafaza edebilir ve bunlara eriebilir.\n<code>Ayarlar-&gt;Czdanlar</code>&#39;dan ekleme, yedekleme yapabilir ve mevcut czdanlar arasnda gei yapabilirsiniz.</p>\n'},
