/*! no static exports found */
/*! all exports used */
/*! ModuleConcatenation bailout: Module is not an ECMAScript module */function(e,t){e.exports='<h1 id="blokzinciri">Blokzinciri</h1>\n<p>Graphene de ou kripto para gibi , transferler ve piyasa hareketleriyle\nilgili katlmclar haberdar  etmek iin blokzincirinden  faydalanr.\nHer blok bir nceki blou kaynak olarak gsterdii iin ada daha nceden \ngereklemi tm ilemleri ieren bir bloklar zinciri (blokzinciri) elde ederiz . Blokzinciri\nak ve eriilebilir ve denetlenebilir bir defteri-kebir olduundan , herkes transferlere,\n piyasa emirlerine ve sipari defterlerine yakndan  bakabilir ve teyit edebilir.</p>\n<p> Tabii ki, bu web czdan denetlemelerinize yardmc olmas iin size bir blok \naratrcs da sunmaktadr.</p>\n<h2 id="mutabakat-mekanizmas-">Mutabakat Mekanizmas</h2>\n<p>Hangi anda ve kimin blok <em>retmeye</em> izni olduu  , <em>Delegated Proof of Stake</em> \n(Yetkilendirilmi-vekil-pay-ispat) denilen mutabakat mekanizmasyla belirlenir. \nEsasnda, Cybex hissedarlar (elinde CYB kuponu olan)  tercih ettikleri blok \nreticilerine blokzincirinde oy verebilirler.  En ok oyu alan o <em>tanklar</em>n\nbloklar retmelerine izin verilir.</p>\n<h2 id="i-lemler">lemler</h2>\n<p>Graphene blokzinciri teknolojisi eitli ilem trleri sunmaktadr.  Kullanclar \naralarnda aktiif transferleri yapabildikleri gibi datk borsayla ilikili \nilemler de vardr. Bu ilem trlerinin bir ou kendini izah eden \nfilerle etiketlenmilerdir, dier ilemler ise irketin i ileriyle alakal daha ok \nbilgi gerektirir.</p>\n'},
