/*! ModuleConcatenation bailout: Module is not an ECMAScript module */function(e,t){e.exports='<h1 id="giri-">Giri</h1>\n<p>Merkezsiz borsa (ksaca <em>DEX</em>) , Cybex ekosisteminde \nalp-satlan dijital mamllerin dorudan takas edilebilmelerini salar.</p>\n<p>Merkezsiz bir borsann , bariz geleneksel borsalardan bir takm avantajlar vardr. \nBunlardan ksaca bahsetmek istiyoruz. Cybex DEX&#39;de hepsi mevcut olmasina \nramen o zellikleri tamamen ya da ksmen lay ile kullanabilmek okuyucuya ve \nmteriye kalmtr.</p>\n<ul>\n<li><strong>Gler Ayrl</strong> : \nIOU &#39;lari piyasaya srme  ve sipari defterlerine ileme grevinden ayn \nkimsenin sorumlu olmasn gerektirecek bir sebep yoktur. Cybex&#39;de ilem \nemirlerin eletirilmesi ii protokol tarafndan yrtlr, protokoln \nilemlere konu olan aktiflerle ilgili bilgisi yoktur, sadece ilem grr.</li>\n<li><strong>Genel Birleik Emir/Sipari Defteri</strong> :\nCybex evrensel olduu iin , internet eriimi olan herkes  DEX&#39;i alm-satm iin \nkullanabilir. Bu, dnyann likiditesini , merkezsiz/datk alm-satm iin tek bir emir \ndefterine getirir.</li>\n<li><strong>Neredeyse Hereyi Alp-Satabilirsiniz</strong> :\nCybex DEX varln muhteviyatn bilmez , dolays ile <strong>her trl</strong>  eleme ticareti \nyaplabilir. GM:ALTIN gibi baz elemeler  az likidite salarken FOREX ticareti \niin USD:EUR gibi elemeler ok byk hacimli ilem grr.</li>\n<li><strong>Limit Yok</strong> :\nCybex protokolnn sizin ticaret deneyiminizi snrlamas mmkn deildir.</li>\n<li><strong>Merkezsiz</strong> :\nDEX (merkezsiz borsa) tm dnyaya datktr. Blece tek krlma noktas \nolmad gibi bu Cybex borsasnn ticaret iin 7/24 ak olduu anlamna \ngelir, nk her zaman dnyada bir yerde vakit mutlaka gndzdr. </li>\n<li><strong>Gvenli</strong> :\nFonlarnz ve ticari ilemleriniz endstriyel seviyedeki eliptik-eri kriptografisiyle tamamen gvence altndadr. \n Kimse siz izin vermedike fonlarnza eriemez.\nGvenlii daha da glendirmek amacyla mterilerimize emanet-escrow ve oklu-\nimza planlar dzenlemelerine imkan tanyoruz.</li>\n<li><strong>Hzl</strong> :\nDier merkezsiz alarn tersine Cybex DEX gerek-zamanl ticarete\n imkan tanr , sadece k hz ve gezegenin bykl \nile snrldr.</li>\n<li><strong>Kantlanabilir Emir Eletirme Algoritmas</strong> :\nCybex DEX i nadir klan eylerden biri de ispatlanabilir emir eletirme \nalgoritmasdr.  Verilen bir takm ilem-emri  iin her zaman bu emirlerin \nkantlanabilir ekilde eletirilmi olduunu teyit edebilirsiniz.</li>\n<li><strong>Teminata Balanm</strong> :\nCybex&#39;in en byk zelliklerinden biri de bitUSD, bitEUR, bitCNY gibi \n<em>akllparalar</em>dr. Kolaylk olsun diye bu varlklar czdan ierisinde USD,EUR,CNY \ndiye ksaltlmlardr. Bu dijital kuponlar dayandklar fiziksel varlkla ayn deeri \ntemsil ederler. Yani bu czdandaki 1 USD nin deeri 1 dolardr ve o ekilde \ndenebilir. Bu kuponlarn hepsinin karl olarak teminat olarak kitli tutulan ve anlk \nfiyatnda hesap grm iin mevcut olabilen, <strong>Cybex&#39;in irket hisseleri (CYB)</strong> \n vardr.</li>\n</ul>\n'},
