/*! ModuleConcatenation bailout: Module is not an ECMAScript module */function(e,t){e.exports='<h1 id="i-zinler">zinler</h1>\n<p>Cybex&#39;de , her hesap ikiye ayrlr </p>\n<ul>\n<li><strong>Etkin  zin</strong>: fonlarn ynetimi ve</li>\n<li><strong>Sahip zni</strong>: hesap ynetimi.</li>\n</ul>\n<p>Her ikisi de hesabnzn <code>zinler</code> sekmesinde <em>yetkiler</em> ve <em>alt-snr</em>&#39;n birlikte \nkullanlmasyla belirlenebilir. lemin geerli olmas iin <em>alt-snr</em> n geilmesi \ngerekmektedir.</p>\n<h2 id="yetkililer">Yetkililer</h2>\n<p>Cybex&#39;de bir <em>yetkili</em>,  transfer veya alm-satm gibi ilemlere yetki veren bir veya \ndaha ok sayda kiiden oluur.</p>\n<p>Bir yetki , bir yada daha fazla sayda hesap ad ve <em>arlk</em> \niftinden oluur.</p>\n<p>Geerli bir ilem elde edebilmek iin , imzalayan taraflarn etki arlklarnn toplam \nizinlerde belirlenmi olan alt-snr geiyor olmas gerekir.  </p>\n<h1 id="-rnekler">rnekler</h1>\n<p>Birka rnee bakarak kullanlan terminolojiye ve kullanm senaryolarna k tutalm. \nAada tanmlanm etkin izinlerle yeni bir hesap oluturulduunu farz edelim. \nDikkatinizi ekeriz , ayn ema sahip izinleri iin de \nie yarar. </p>\n<h2 id="-d-z-ok-i-mzal-">(Dz) ok-mzal</h2>\n<p>Dz ok-imzal bir ema, ilemin geerli olabilmesi iin aralarndan &#39;N&#39; sayda kiinin \nimzas gerekli  toplam &#39;M&#39; sayda kiiden oluur. imdi biz, Cybex&#39;de, &#39;M&#39; \nve &#39;N&#39; yerine <em>arlklar</em> ve <em>alt-snr</em>  kullanyoruz. imdi greceimiz gibi tamamen \nayn sonuca ok daha esnek bir ekilde varacaz.  </p>\n<p>Gelin yle farz edelim , Alice, Bob, Charlie ve Dennis&#39;in ortak fonlar olsun . \nEer yalnzca ikisi anlarlarsa geerli olabilecek bir ilem oluturmak istiyoruz .\nDolaysyla <strong>4-n-2-si</strong> (M-in-N-i) emas yle grnr : </p>\n<table>\n<thead>\n<tr>\n<th>Hesap</th>\n<th>Arlk</th>\n</tr>\n</thead>\n<tbody><tr>\n<td>Alice</td>\n<td>33%</td>\n</tr>\n<tr>\n<td>Bob</td>\n<td>33%</td>\n</tr>\n<tr>\n<td>Charlie</td>\n<td>33%</td>\n</tr>\n<tr>\n<td>Dennis</td>\n<td>33%</td>\n</tr>\n<tr>\n<td>----------</td>\n<td>------</td>\n</tr>\n<tr>\n<td>Alt Snr :</td>\n<td>51%</td>\n</tr>\n</tbody></table>\n<p>Katlmclarn her birinin 33% etki arl var fakat alt snr 51%  olarak ayarlanm.\nDolaysyla  ilemi geerli klmak iin 4 kiiden sadece 2 sinin anlamas yeterlidir.</p>\n<p>Alternatif olarak, bir 4-n-3&#39; emas oluturmak iin ya arlklar 17% ye indirebiliriz \nyada alt-snr 99%&#39;a ykseltebiliriz. </p>\n<h2 id="-d-z-esnek-ok-i-mzal-">(Dz) Esnek ok-mzal</h2>\n<p>Alt-snr ve arlklar sayesinde fonlarmzla imdi daha esneiz, yada daha dorusu \ndaha fazla <em>hakimiyetimiz</em> var. Mesela , farkl kiiler iin ayr arlklar belirleyebiliriz.\nFarzedelim ki Alice fonlarn oklu-imza emas kullanarak hrszla kar korumak \nistiyor fakat ayn zamanda arkadalarna da gereinden fazla hakimiyet teslim etmek \nistemiyor. O zaman una benzer bir yetki oluturuyoruz :</p>\n<table>\n<thead>\n<tr>\n<th>Hesap</th>\n<th>Arlk</th>\n</tr>\n</thead>\n<tbody><tr>\n<td>Alice</td>\n<td>49%</td>\n</tr>\n<tr>\n<td>Bob</td>\n<td>25%</td>\n</tr>\n<tr>\n<td>Charlie</td>\n<td>25%</td>\n</tr>\n<tr>\n<td>Dennis</td>\n<td>10%</td>\n</tr>\n<tr>\n<td>----------</td>\n<td>------</td>\n</tr>\n<tr>\n<td>Alt Snr :</td>\n<td>51%</td>\n</tr>\n</tbody></table>\n<p>imdi, fonlara Alice tek bir arkadayla yada  tm  arkadayla birlikte eriebilme \nimkanna sahip olur.</p>\n<h2 id="-ok-basamakl-esnek-oklu-i-mza">ok-Basamakl Esnek oklu-mza</h2>\n<p>Gelin beraber basit bir ok-basamakl anonim hesap kurulumuna gz atalm. Mali ler \nMdr (MM) ve onun iin altnda alan Vezne, Deneti, Vergi Mdr, Muhasebe vb. gibi \ndepartmanlar olan bir irkete bakyor olalm.  Bir de harcama ayrcalklarna sahip\nolmay  isteyen bir CEO&#39;su olsun. \nO zaman biz fonlar iin unlara gre bir yetki olutururuz :</p>\n<table>\n<thead>\n<tr>\n<th>Hesap</th>\n<th>Arlk</th>\n</tr>\n</thead>\n<tbody><tr>\n<td>CEO.RKET</td>\n<td>51%</td>\n</tr>\n<tr>\n<td>MM.RKET</td>\n<td>51%</td>\n</tr>\n<tr>\n<td>----------</td>\n<td>------</td>\n</tr>\n<tr>\n<td>Alt Snr :</td>\n<td>51%</td>\n</tr>\n</tbody></table>\n<p>burada CEO.RKET ve MM.RKET in kendilerine ait ayr yetkileri var.  Mesela \nMM.RKET hesab yle olabilir :</p>\n<table>\n<thead>\n<tr>\n<th>MM.RKET</th>\n<th>Arlk</th>\n</tr>\n</thead>\n<tbody><tr>\n<td>Mdr.RKET</td>\n<td>51%</td>\n</tr>\n<tr>\n<td>Vezne.RKET</td>\n<td>33%</td>\n</tr>\n<tr>\n<td>Deneti.RKET</td>\n<td>33%</td>\n</tr>\n<tr>\n<td>Vergi Mdr.RKET</td>\n<td>10%</td>\n</tr>\n<tr>\n<td>Muhasebe.RKET</td>\n<td>10%</td>\n</tr>\n<tr>\n<td>-------------------</td>\n<td>------</td>\n</tr>\n<tr>\n<td>Alt-snr :</td>\n<td>51%</td>\n</tr>\n</tbody></table>\n<p>Bu ema fonlarn harcanabilmesi iin  kiilere yle izinler verir :</p>\n<ul>\n<li>CEO  tek bana</li>\n<li>Mali ler Mdrn tek bana </li>\n<li>Vezne ve Deneti birlikte</li>\n<li>Deneti veya Veznedar , Vergi Mdr ve Muhasebeciyle birlikte \nharcama.</li>\n</ul>\n<p>Dolaysyla grldld gibi yetkilendirmeleri geliigzel derinlikte yayarak her trl \ni alanna uyacak esneklikte uygulamak mmkn.</p>\n'},
