/*! ModuleConcatenation bailout: Module is not an ECMAScript module */function(e,t){e.exports='<h1 id="cuentas">Cuentas</h1>\n<p>Como ya se habr notado, esta tecnologa blockchain requiere que usted\nregistre un nombre de cuenta. Esto trae numerosas ventajas. Adems de incrementar\nla escalabilidad, hemos separado la identidad de la firma autorizante\n de las transacciones. En la prctica, <em>ser propietario de una cuenta</em> es independiente de poder\n<em>utilizar sus fondos&quot;. Adicionalmente, ambos derechos (que llamamos &quot;permisos&quot;) pueden\ncombinarse en una compleja relacin arbitraria entre personas (que llamamos &quot;autoridades&quot;)\nusando los parmetros *peso</em> y <em>humbral</em>.</p>\n'},
