/*! ModuleConcatenation bailout: Module is not an ECMAScript module */function(e,t){e.exports="<p>[# permissions]\nPermissions define the available features for an asset. However, even if a feature is permitted, it must still be activated using the corresponding flag in order to be enforced by the blockchain.</p>\n<p>After creation, you may only remove a given permission, you cannot enable a permission that was disabled on creation.</p>\n<p>[# flags]\nFlags define which asset features are active or inactive. They can be switched on and off by the asset owner at any time.</p>\n"},
/*!*******************************!*\
  !*** ./help/en/assets/uia.md ***!
  \*******************************/
/*! no static exports found */
/*! all exports used */
/*! ModuleConcatenation bailout: Module is not an ECMAScript module */function(e,t){e.exports='<h1 id="user-issued-assets">User Issued Assets</h1>\n<p>In addition to the aforementioned <em>market pegged</em> assets, Cybex allows\nindividuals and companies to create and issue their own tokens for anything\nthey can imagine. The potential use cases for so called user-issued assets\n(UIA) are innumerable. On the one hand, UIAs can be used as simple event\ntickets deposited on the customers mobile phone to pass the entrance of a\nconcert. On the other hand, they can be used for crowd funding, ownership\ntracking or even to sell equity of a company in form of stock.</p>\n<p>Obviously, the regulations that apply to each kind of token vary widely and are\noften different in every jurisdiction. Hence, Cybex comes with tools that\nallow issuers to remain compliant with all applicable regulations when issuing\nassets assuming regulators allow such assets in the first place.</p>\n'},
/*!*****************************************!*\
  !*** ./help/en/assets/privbitassets.md ***!
  \*****************************************/
/*! no static exports found */
/*! all exports used */
/*! ModuleConcatenation bailout: Module is not an ECMAScript module */function(e,t){e.exports='<h1 id="privatized-bitassets">Privatized BitAssets</h1>\n<p>Privatized BitAssets serve those customers that would like to issue a market\npegged asset but do not want the witnesses to publish the prices. Instead, when\ncreating a <em>privatized</em> bitasset, the issuer can define a set of authorities that\nare allowed to publish the price for that particular asset. The issuer can\nfurther define all kinds of fees involving this asset and make a profit.</p>\n<p>This feature is of particular interest for exchanges and institutes that have\naccess to real-time prices and would like to increase exposure and volume.</p>\n'},
/*!*******************************!*\
  !*** ./help/en/assets/mpa.md ***!
  \*******************************/
/*! no static exports found */
/*! all exports used */
/*! ModuleConcatenation bailout: Module is not an ECMAScript module */function(e,t){e.exports='<h1 id="market-pegged-assets">Market Pegged Assets</h1>\n<p>A crypto-currency, with the properties and advantages of Bitcoin, that is\ncapable of maintaining price parity with a globally adopted currency (e.g. U.S.\ndollar), has high utility for convenient and censorship resistant commerce. This\ncan be achieved by Cybex&#39; market pegged assets (MPA), a new type of freely\ntraded digital asset whose value is meant to track the value of a conventional\nunderlying asset by means of contracts for difference (CFD). </p>\n<p>A <em>SmartCoin</em> (synonym for MPA) is a crypto-currency that <em>always</em> has 100% or\nmore of its value backed by the Cybex core currency (CYB), to which they can\nbe converted at any time, as <em>collateral</em> in a CFD.</p>\n<p>What makes MPAs unique is that they are free from counterparty risk even though\nthey resemble a CFD backed by collateral. This is achievable by letting the\nnetwork itself (implemented as a software protocol) be responsible for securing\nthe collateral and performing settlements as will be described in more detail\nbelow.</p>\n<p>This is a subset of the available market pegged assets:</p>\n<ul>\n<li>BitUSD</li>\n<li>BitCNY</li>\n<li>BitEUR</li>\n<li>BitGOLD</li>\n<li>...</li>\n</ul>\n'},
